import React, { Component } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import LoginScreen from './components/Login';
import SignupScreen from './components/Signup';
import MainScreen from './components/Main';
import AddContactsScreen from './components/AddContact';
import ChatNavigatorScreen from './components/ChatNavigator';
import BlockedScreen from './components/Blocked';
import ContactNavigatorScreen from './components/ContactNavigator';
import ChatScreen from './components/Chat';
import ContactScreen from './components/Contacts';


const Stack = createNativeStackNavigator();
const Tab = createBottomTabNavigator();

function MainTabs() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Contacts" component={ContactScreen} />

      <Tab.Screen name="AddContact" component={AddContactsScreen} />
      <Tab.Screen name="ChatNavigator" component={ChatNavigatorScreen} />
      <Tab.Screen name="Blocked" component={BlockedScreen} />
      <Tab.Screen name="ContactNavigator" component={ContactNavigatorScreen} />
    </Tab.Navigator>
  );
}

function MainStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Login" component={LoginScreen} />
      <Stack.Screen name="Signup" component={SignupScreen} />
      <Stack.Screen name="Main" component={MainTabs} />
      <Stack.Screen name="Chat" component={ChatScreen} />
    </Stack.Navigator>
  );
}

export default class App extends Component {
  render() {
    return (
      <NavigationContainer>
        <MainStack />
      </NavigationContainer>
    );
  }
}
